import React from 'react';
import './ab.css';
import Gsap from './Gsap';
import { Col, Row } from 'reactstrap';
import kenny from '../assets/ken2.png';
import pattern from '../assets/path27.png';
import Fade from 'react-reveal/Fade';
import Zoom from 'react-reveal/Zoom';
import { Label } from 'semantic-ui-react';

const About = () => {
	return (
		<div className="ab" id="about">
			<Row className="columns">
				<Col className="image2" md="3">
					<Zoom left fraction={1}>
						<img className="pattern2" src={pattern} alt="" />
						<img className="kennys2" src={kenny} alt="" />
					</Zoom>
				</Col>
				<Col md="9">
					<Fade left collapse>
						<h1 className="competences">COMPETENCES</h1>
					</Fade>
					{/* <p className="comp">
						Développeur web fullstack autodidacte de 28 ans basé sur Avignon, j'ai suivi une formation de
						développeur web à la Wild Code School. <br />
						Le développement web est une de mes passions que je cultive au quotidien. <br />
						Je suis passionné par l'UX-UI design, les créations web, la manipulation de bases de données et
						toutes les dernières technologies. <br />
						J'aime expérimenter, créer et relever de nouveaux défis. <br />
						Si vous êtes intéressé par mon profil ou que vous voulez en savoir plus sur moi, n'hésitez pas à
						me contacter.
					</p> */}
					{/* <Gsap /> */}
					<Label as="a" image>
						<img src="/images/avatar/small/joe.jpg" />
						Joe
					</Label>
					<Label as="a" image>
						<img src="/images/avatar/small/elliot.jpg" />
						Elliot
					</Label>
					<Label as="a" image>
						<img src="/images/avatar/small/stevie.jpg" />
						Stevie
					</Label>
				</Col>
			</Row>
		</div>
	);
};

export default About;
